window.bookSummaryJSON = "<p>The Aleph were nearly wiped out for tampering with technology borne from Jukal Portals. The Demons of Devil Crater were almost turned to a footnote in history for rebelling against the Dark God. The Beast Kin were seen as a threat with their natural high affinities.</p> <p>Now all of these races have started to come back - the first stage in Bob's plan to save Emerilia.</p> <p>With the Stone Raider's help, the Aleph have recovered their cities, stepping down the path to reviving their society. Now the Demon's and Beast Kin of Devil's Crater ask the Stone Raiders to once again stand with an exiled race.</p> <p>This is their land, and they will fight the pantheon and Jukal to the bitter end in order to defend it.</p>"; 
